export const ACTIONS = {
  ACTIVE_PAGE: "ACTIVE_PAGE",
  UPDATE_QUOTE: "UPDATE_QUOTE",
};

export function updateQuote(quoteData) {
  return {
    type: ACTIONS.UPDATE_QUOTE,
    quoteData,
  };
}
